INSERT INTO `tipo_certificacion` (`id`, `nombre`, `imagen`, `descripcion`) VALUES
(1, 'CCNA R_S 5.0', 'uploads/M1MlTEK8AqaB58Ht6POosZBb713fOvffZfxt2Ykq.jpeg', 'Cisco Certified Network Associate (CCNA) Routing y Switching es un programa de certificación para los ingenieros de red de nivel básico que ayuda a maximizar su inversión en conocimientos de redes.'),
(2, 'CISCO CCNA 4.0 Exploration', 'uploads/ccna.jpg', 'Curso CCNA Discovery, Introducción al enrutamiento y a la conmutación en la empresa. El objetivo de este curso es ayudarlo a desarrollar las habilidades necesarias para usar protocolos a fin de maximizar el rendimiento de las LAN y WAN empresariales. El curso proporciona más configuraciones avanzadas de protocolos de conmutación y enrutamiento, configuraciones de las listas de control de acceso y la implementación básica de enlaces WAN. También proporciona una orientación detallada de solución de problemas relativos a las implementaciones de LAN, WAN y VLAN. Este curso le brinda las habilidades necesarias para las tareas de técnico de red, técnico de soporte y técnico de computadoras de nivel inicial'),
(3, 'CISCO CCNA WIRELESS', 'uploads/ccna_wireless.png', 'La certificación en Wireless, comprueba las calificaciones de los administradores en red, técnicos en redes wireless, técnicos en soporte, ingenieros en seguridad enfocados en redes wireless, administradores de redes WLAN y especialistas en redes wireless. Esta certificación valida la habilidad de instalar, configurar, monitorear y resolver problemas de soluciones CISCO WLAN en ambientes empresariales y SMB.'),
(4, 'CISCO CCNA SECURITY', 'uploads/ccnasecurity.jpg', 'Actualmente, hay mucha demanda de profesionales especializados en ciberseguridad que pueden proteger y defender la red de una organización. Ponga a trabajar sus aptitudes de detective: estudie para convertirse en un profesional que combata la ciberdelincuencia.'),
(5, 'CISCO CCNP', 'uploads/ccnp.jpg', 'Cisco Certified Network Professional (CCNP) Routing and Switching certification validates the ability to plan, implement, verify and troubleshoot local and wide-area enterprise networks and work collaboratively with specialists on advanced security, voice, wireless and video solutions.'),
(6, 'CCNA R y S 6.0', 'uploads/ccnarys.jpg', '');
